setInterval(slideshow,2000);
var i =0;
function slideshow(){
    
    var slide = ImgArr[i].image;
    var img = document.createElement("img");
    img.setAttribute("src",slide);
    document.querySelector("#slideshow").innerHTML="";
    document.querySelector("#slideshow").append(img);
    if(i<ImgArr.length-1){
        i++;
    }
    else{
        i=0;
    }
}


function mySort(){

    if(document.querySelector("#sort-buttons > select").value=="High to low"){
        Movie.sort(function(a,b){
        return b.rating-a.rating;
      })
    }
    else if(document.querySelector("#sort-buttons > select").value=="Low to high"){
        Movie.sort(function(a,b){
            return a.rating - b.rating;
          })
    }
    
      document.querySelector("#movies").innerHTML="";
      createPage();

}
function createPage(){
    Movie.map(function(elem){
        // console.log(elem.image)
        // var par = document.createElement("div");
        // var movies = document.getElementById("movies");
        // movies.appendChild(par);
        // var imgDiv = document.createElement("div");
        // var image = document.createElement("img")
        // image.src=elem.image;
        // imgDiv.append(image);
        // par.append(imgDiv);
        var div1 = document.createElement("div");
        div1.setAttribute("class","box");
        var div2 = document.createElement("div");
        var imag = document.createElement("img");
        imag.setAttribute("src",elem.image);
        var div3 = document.createElement("div");
        var head2 = document.createElement("h2");
        head2.innerHTML=elem.name;
        var head4 =document.createElement("h4");
        head4.innerHTML=elem.type;
        var head5 = document.createElement("h4");
        head5.innerHTML=elem.rating + " " ;
        var iTag = document.createElement("i");
        iTag.setAttribute("class","fas fa-star");
        head5.append(iTag);
        div2.append(imag);
        div3.append(head2,head4,head5);
        div1.append(div2,div3);
        document.querySelector("#movies").append(div1);
    });
}
createPage();